import { Card } from "../models/card.model";
import { Injectable } from "@angular/core";

@Injectable({
    providedIn: 'root'
})

export class CardService{
    
    hand: Card[] = []

    constructor(){}

    addCard(valueCard: number, colorCard: string, imgCard: string){
        console.log(valueCard, colorCard, imgCard)
        this.hand.push({
            value: valueCard,
            color: colorCard,
            img: imgCard
        })
    }

}
